  useEffect(()=>{
    getNotes()
  }, [])

  let getNotes = async() => {
    let response = await fetch('http://127.0.0.1:8000/api/notes/', {
      method:'GET',
      headers:{
        'Content-Type' : 'application/json',
        'Authorization' : 'Bearer ' + String(authTokens.access)
      }
    })
    let data = await response.json()
    console.log(data)
    setNotes(data)
    console.log(data)
  }


